import React from "react";
import Slider from "react-slick";
import ava01 from "../../assets/images/ava-1.jpg";
import ava02 from "../../assets/images/ava-2.jpg";
import ava03 from "../../assets/images/ava-3.jpg";

const Testimonials = () => {
  return (
    <Slider className="testimonial py-4 px-3">
      <p>
        Lorem ipsum dolor sit, amet consectetur adipisicing elit. Natus, ullam.
        Similique rem nihil, deleniti illo autem error! Sit nihil, dolore harum
        similique dolorum vel, impedit, natus itaque consequuntur blanditiis
        aliquid.
      </p>

      <div className="d-flex align-items-center gap-4 mt-3">
        <img src={ava01} className="w-25 h-25 rounded" alt="" />
      </div>
    </Slider>
  );
};

export default Testimonials;
